import "../styles/sendreceive.css";
import Search from "./Search";
import Passcode from "./Passcode";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPaperPlane } from "@fortawesome/free-solid-svg-icons";
import { faArrowAltCircleDown } from "@fortawesome/free-solid-svg-icons";
export const SendReceive = () => {
  const [search, setSearch] = useState(false);
  const [passcode, setPasscode] = useState(false);
  function searcht(params) {
    setPasscode(false);
    setSearch(true);
    let x = (document.getElementById("s").style.backgroundColor = "red");
    let y = (document.getElementById("r").style.backgroundColor =
      "cornflowerblue");
  }
  function passcodet(params) {
    setPasscode(true);
    setSearch(false);
    let x = (document.getElementById("r").style.backgroundColor = "red");
    let y = (document.getElementById("s").style.backgroundColor =
      "cornflowerblue");
  }
  return (
    <div className="containerSR">
      <div className="searchCodeContainer">
        {search && <Search />}
        {passcode && <Passcode />}
      </div>
      <div className="sendReceiveContainer">
        <button className="srButton" id="s" onClick={() => searcht()}>
          <FontAwesomeIcon icon={faPaperPlane} size="2x" />
        </button>
        <button className="srButton" id="r" onClick={() => passcodet()}>
          <FontAwesomeIcon icon={faArrowAltCircleDown} size="3x" />
        </button>
      </div>
    </div>
  );
};
